import React from 'react';
import {Menu, Button} from 'semantic-ui-react';
import {Link} from 'react-router-dom';
const SignedOutMenu = ({signIn, valid}) => {
    console.log(valid);
    return (
        <Menu.Item position = "right">
            {/* <Button onClick = {signIn} positive inverted content = "Login"/> */}
             <Button primary as = {Link} to = "/login" onClick = {signIn} style = {{marginRight : '2.5px'}}>Login</Button>
            <Button primary as = {Link} to = "/signup" content = "Sign Up" style = {{marginLeft : '2.5px'}}/>
        </Menu.Item>
        );
}

export default SignedOutMenu;
